int main(int argc, const char * argv[])
{
    int n;
    scanf("%d", &n);
    int mat1[n][n];
    for(int i = 0; i < n; i++) {
        for(int j = 0; j < n; j++) {
            scanf("%d", &mat1[i][j]);
        }
    }
    
    int m;
    scanf("%d", &m);
    int mat2[m][m];
    for(int i = 0; i < m; i++) {
        for(int j = 0; j < m; j++) {
            scanf("%d", &mat2[i][j]);
        }
    }
    
    int pom;
    if(n < m) {
        pom = n;
    }
    else {
        pom = m;
    }
    
    for(int i = 0; i < pom; i++) {
        if(mat1[i][i] == mat2[i][i]) {
            int sum1 = 0;
            for(int j = i + 1; j < n; j++) {
                sum1 += mat1[i][j];
            }
            mat1[i][i] = sum1;
            
            int sum2 = 0;
            for(int j = i + 1; j < m; j++) {
                sum2 += mat2[i][j];
            }
            mat2[i][i] = sum2;
        }
    }
    
    for(int i = 0; i < n; i++) {
        for(int j = 0; j < n; j++) {
            printf("%d ", mat1[i][j]);
        }
        printf("\n");
    }
    
    for(int i = 0; i < m; i++) {
        for(int j = 0; j < m; j++) {
            printf("%d ", mat2[i][j]);
        }
        printf("\n");
    }
    return 0;
}
