void solve(){
	int n;
	cin >> n;
	string s;
	int cnt = 0, e = 0, o = 0;
	for(int i = 0; i<n; i++){
		cin >> s;
		int sz = s.size();
		int _1 = count(all(s), '1');
		int _0 = sz - _1;
		if(sz&1){
		     // if length is odd then any binary string could be a palindrome by swapping.
			o++;
		}
		else{ // even length:
 			if(!(_0&1)){
 		    //case 1.already palindrome if it has even #0 and even #1.
			//(dosn't matter initially palindrome or not, surely it will be palindrome after swapping)
 			     e++;
 			}
			else{ // case 2: then it has surely odd #1 and odd #0. 
				  //we just swap one element (0 or 1 dosn't matter) from odd lenght string.
				  //or another not palindrome even string. thats' it!!
				cnt++;
			}
		}
	}
	if(!(o+e)) // no palindrome is inittialy found means all are even lenght containing odd nummber of 0 and 1.
		cout << n - (n&1) << '\n';
	else if(o) // odd length of palindrome found then any even length non palindrome could be palindrome by swapping
		cout << n << '\n';
	else // some even length palindrome and non palindrome.
		cout << e + cnt - (cnt&1) << '\n';
}

