    try {
        categoryName = categoryName.replace(/[a-zA-Z]/g, c => c.toLowerCase());
        const category = new Category({
            categoryName,
            categoryDescription,
            categoryImage
        });
        await category.save();
        return category;
    } catch (error) {
        log.error(error);
        return null;
    }
}

